import React from 'react'
import './App.css'
import outes from './components/routes'
import { Routes, Route } from 'react-router-dom';
import Home from './components/home';
const App = () => {
  return (
    <>
    <Routes>
       <Route path="/" element={<routes />} />
       <Route path="/home" element={<Home />} />
    </Routes>
 </>
  )
}

export default App
